import './About.css';
const About=()=>{
return(
    <React.Fragment>
  <header class="masthead">
    <div class="container h-100">
      <div class="row h-100 align-items-center justify-content-center text-center">
        <div class="col-lg-10 align-self-end">
          <h1 style={{text:"uppercase", text:"white", font:"bold"}}>Support the community by offering voluntary services & support</h1>
        
        </div>
      
      </div>
    </div>
  </header>
  

    </React.Fragment>
)
}



export default About;
